import Moon from "../assets/icon-moon.svg";
import Sun from "../assets/icon-sun.svg";
import SearchIcon from "../assets/icon-search.svg";
import Location from "../assets/icon-location.svg";
import Website from "../assets/icon-website.svg";
import Twitter from "../assets/icon-twitter.svg";
import Company from "../assets/icon-company.svg";
import { useState, useEffect } from "react";

const API_BASE_URL = 'https://api.github.com/users/';


const Searcher = () => {
    const [darkMode, setDarkMode] = useState(false);
    const [searchTerm, setSearchTerm] = useState('');
    const [userData, setUserData] = useState({});

    useEffect(() => {
        if (!searchTerm) return;
        fetch(`${API_BASE_URL}${searchTerm}`)
        .then(res => res.json())
        .then(data => setUserData(data))
        .ctch(error => console.error(error));
    }, [searchTerm]);

    const handleSubmit = (event) => {
        event.preventDefault();
        setSearchTerm(event.target.elements.searchInput.value);
    }


  return (
    <div id="container" className={darkMode ? 'dark-mode' : ''}>
      <header id="header">
        <h1 id="title">devfinder</h1>
        <button typ="button" id="btn-mode" onClick={() => setDarkMode(!darkMode)}>
  <p id="mode-text">{darkMode ? 'Light' : 'Dark'}</p>
          <img id="moonIcon" src={darkMode ? Sun : Moon} alt="Icon Sun/Moon" />
        </button>
      </header>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Search GitHub username..."
          id="search-input"
          style={{
            backgroundImage: `url(${SearchIcon})`,
            backgroundRepeat: "no-repeat",
            backgroundPosition: "5% center",
            paddingLeft: "14%",
          }}
        />
        <button type="submit" id="search-button">
          Search
        </button>
      </form>
      <div id="main">
        <div id="profile-section">
          <div id="profile-container">
              <img src={userData.avatar_url} alt="User avatar"/>
          </div>
          <div id="username-section">
            <h3 id="user-name">{userData.name}</h3>
            <a href={userData.html_url} id="user-name-link">
              @{userData.login}
            </a>
        <p id="join-date">joined {new Date(userData.created_at).toDateString()}</p>
          </div>
        </div>
        <p id="user-description">{userData.bio}</p>
      <div id="grid-div">
        <div id="repos">Repos</div>
        <div id="followers">Followers</div>
        <div id="following">Following</div>
        <div id="repos-number">{userData.public_repos}</div>
        <div id="followers-number">{userData.followers}</div>
        <div id="following-number">{userData.following}</div>
      </div>
      <div id="links-grid">
        <img id="location" src={Location} alt="Icon Location" />
        <a  href={userData.location} id="location-link">
          {userData.location || 'Not Available'}
        </a>
        <img id="website" src={Website} alt="Icon Website" />
        <a  href={userData.blog} id="website-link">
          {userData.location || 'Not Available'}
        </a>
        <img id="twitter" src={Twitter} alt="Icon Twitter" />
        <a  href={userData.twitter_username} id="twitter-link">
          {userData.twitter_username || 'Not Available'}
        </a>
        <img id="company" src={Company} alt="Icon company" />
        <a  href={userData.company} id="company-link">
          {userData.company || 'Not Available'}
        </a>
      </div>
      </div>
    </div>
  );
};

export default Searcher;
